import React from 'react';
import './App.css';

function App() {
  return(
  <div className="ReactApp">
    <header className="header">
      <h1 className="title">UniMatched!</h1>
    </header>
    <p className="UniMatched landing page">
      Welcome to the landing page of UniMatched
    </p>
  </div>
  );
}

export default App
